metadata.description:
a series of unique patterns, some rotated, some not, 8 different color schemes.
10% chance for a grainy image.

@jeromeherrcc (2021)

A quiet and meditative wandering above the Sea of Monoliths. Created by Parse/Error (@ufunk_parse) on FX(HASH).

// Even better in full screen (click the "Open Live" button)
// Use your mouse to change point of view

Features:
// 3 FOV
// 3 Fly Speed
// 10 x 2 Palettes (normal/inverted)
// 1 Special Dark Mode
// 9 Light Color
// 9 Fog Color
// 5 Instance Amounts
// 2 Alignment
// Random Empty Space
// 3 Wave
// 3 Wave Strength
// 3 Noise Scale
// 3 Noise Amplitude
// 3 Noise Speed
// 3 Rotation Speed
// 2 Rotation direction

Every day I'm working with charts at work, might as well turn them into my first generative art.

Variations:
9 Different palettes;
5 Types of top charts;
4 Types of main charts;
7 Types of shadow charts


All made in p5.js
